import os
import csv

from utils.constants import FEMALE, MALE

data_folder = 'data'


def convert_date_folder():
    """
    Convert all 'table' files from data folder to dict
    """
    for file in os.listdir(data_folder):
        if file.startswith('table'):
            dict_final = {}
            with open(f'{data_folder}/{file}', 'r', encoding='utf-8', newline='') as f:
                data = list(csv.reader(f))

            dict_final["Endurance"] = []
            dict_final["Agility"] = []
            dict_final["Throwing"] = []
            dict_final["Jumping"] = []
            dict_final["Sprinting"] = []
            dict_final["Coordination"] = []

            for i, row in enumerate(data):
                if i == 0 or i == len(data) - 1:
                    continue
                dict_final["Endurance"].append(row[0])
                dict_final["Agility"].append(row[1])
                dict_final["Throwing"].append(row[2])
                dict_final["Jumping"].append(row[3])
                dict_final["Sprinting"].append(row[4])
                dict_final["Coordination"].append(row[5])

            print(f'{file.lower().replace('table', 'table_').replace('.csv', '')} = {dict_final}')


